import React from "react";
import InvitationPage from "./invitation/InvitationPage";
import { BrowserRouter, Route } from "react-router-dom";
import UserLoggedTabs from "../layout/tabs/UserLoggedTabs";


const DashboardUserLogged = () => {

    return (
        <BrowserRouter>

            <div className="containter">
                <Route exact path="/" component={UserLoggedTabs}></Route>
                <Route path="/invitations" component={InvitationPage} />
            </div>

        </BrowserRouter>

    );


};

export default DashboardUserLogged
